import React from 'react';
import { FiPhone, FiMail, FiMessageSquare } from 'react-icons/fi';

const Contacts1 = ({ darkMode }) => {
  const contacts = [
    { name: 'Tino', sip: '701', img: '/images/tino.png' },
    { name: 'Sarath', sip: '702', img: '/images/sarath.png' },
    { name: 'John', sip: '703', img: '/images/john.png' },
    { name: 'Vikaas', sip: '704', img: '/images/vikaas.png' },
    { name: 'Dharshu', sip: '705', img: '/images/dharshu.png' },
    { name: 'Mathi', sip: '706', img: '/images/mathi.png' },
    { name: 'Sridhar', sip: '707', img: '/images/sridhar.png' },
    { name: 'Nandhini', sip: '708', img: '/images/nandhini.png' },
    { name: 'Raagini', sip: '709', img: '/images/raagini.png' },
  ];

  return (
    <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
      {contacts.map((contact) => (
        <div
          key={contact.sip}
          className={`flex flex-col items-center p-6 rounded-xl shadow-lg transition-all duration-300 transform hover:scale-105 ${
            darkMode ? 'bg-gray-700 text-white' : 'bg-white text-gray-900'
          }`}
        >
          <img
            src={contact.img}
            alt={contact.name}
            className="w-24 h-24 rounded-full object-cover border-4 border-blue-500 shadow-md"
          />
          <h3 className="mt-4 text-xl font-semibold">{contact.name}</h3>
          <p className={`text-sm ${darkMode ? 'text-gray-300' : 'text-gray-500'}`}>SIP: {contact.sip}</p>
          <div className="mt-4 flex space-x-4">
            <button className="p-2 rounded-full bg-green-500 text-white hover:bg-green-600 transition-colors duration-200">
              <FiPhone />
            </button>
            <button className="p-2 rounded-full bg-blue-500 text-white hover:bg-blue-600 transition-colors duration-200">
              <FiMail />
            </button>
            <button className="p-2 rounded-full bg-yellow-500 text-white hover:bg-yellow-600 transition-colors duration-200">
              <FiMessageSquare />
            </button>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Contacts1;
